import "../css_styles/cards.css";

const tech = {
  title: "title",
  urlToImage:
    "https://staticg.sportskeeda.com/editor/2021/11/caca5-16370851386444-1920.jpg",
  description: "description",
  author: "author",
  content: "content",
};
const Celeb = () => {
  return (
    <div className="celeb">
      <div className="celeb_song">song</div>
      <div className="celeb_event">event</div>
      <div className="celeb_drama">drama</div>
    </div>
  );
};

export default Celeb;
